import React, { useState } from "react";

function InputCookie() {
  const [cookie, setCookie] = useState();

  return (
    <div>
      <input
        type={"text"}
        placeholder={"Input cookie KMA"}
        name="cookie"
        value={cookie}
      ></input>
      <button>Crawl TKB</button>
    </div>
  );
}
export default InputCookie;
